import React from "react";
//Imports
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faLinkedinIn } from "@fortawesome/free-brands-svg-icons";
import {} from "@fortawesome/free-brands-svg-icons";
//Types
import { SocialMedia } from "../Types/Types";

const ContactMe = () => {
	const socialMedia: SocialMedia[] = [
		{
			name: "Linkedin",
			link: "https://www.linkedin.com/in/justin-cabrera-a725001a2/",
			tag: "Justin Cabrera",
		},
		{ name: "Gmail", link: "https://", tag: "Justin Cabrera" },
	];

	return (
		<div>
			<article>
				<h1>I am active in the following platforms</h1>
				<ul>
					<li>
						<a
							href='https://www.linkedin.com/in/justin-cabrera-a725001a2/'
							target='_blank'>
							<FontAwesomeIcon icon={faLinkedinIn} /> Justin Cabrera
						</a>
					</li>
				</ul>
			</article>
		</div>
	);
};

export default ContactMe;
